import React from 'react';
import Iframe from 'react-iframe';
import Widget3 from './Widget3';

class Widget4 extends React.Component{

    render(){

        return(
            <Iframe 
            id="dzplayer" 
            dztype="dzplayer" 
            src="http://developers.deezer.com/fr/plugins/player?playlist=true&width=700&height=240&autoplay=false&type=playlist&id=30595446" 
            scrolling="no" 
            frameborder="0" 
            style="border:none; overflow:hidden;" 
            width="700" 
            height="240" a
            llowTransparency="true">

            </Iframe>
        )
    }
}
export default Widget4;
